if mibBuilder.loadTexts: ieee8021PSFPAdminControlList.setDescription('The administrative value of the ControlList parameter for the gate. The octet string value represents the contents of the control list as an ordered list of entries, each encoded as a TLV, as follows. The first octet of each TLV is interpreted as an unsigned integer representing a gate operation name: 0: SetGateAndIPV 1-255: Reserved for future gate operations The second octet of the TLV is the length field, interpreted as an unsigned integer, indicating the number of octets of the value that follows the length. A length of zero indicates that there is no value (i.e., the gate operation has no parameters). The third through (3 + length -1)th octets encode the parameters of the gate operation, in the order that they appear in the definition of the operation in Table 8-4. Three parameter types are defined: - StreamGateState: A GateState parameter is encoded in a single octet, and is interpreted as an integer value. The value 1 indicates open; the value 2 indicates closed. - IPV: An IPV is encoded in four octets as a 32-bit signed integer. A negative denotes the null value; zero or positive values denote internal priority values. - TimeInterval: A TimeInterval is encoded in 4 octets as a 32-bit unsigned integer, representing a number of nanoseconds. The first octet encodes the most significant 8 bits of the integer, and the fourth octet encodes the least significant 8 bits. - IntervalOctetMax: An integer representing the maximum number of MSDU octets that are permitted to pas the gate during the specified TimeInterval. If this parameter is omitted, there is no maximum. The value of this object MUST be retained across reinitializations of the management system.')
